INSERT INTO `Pessoa` VALUES (1,'Prudente Imobiliária','<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:95%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>A&nbsp;<strong>CONSULTORIA IMOBILI&Aacute;RIA PRUDENTE&nbsp;</strong>&nbsp;iniciou suas atividades em 2011 visando construir a sua hist&oacute;ria no mercado imobili&aacute;rio &nbsp;no interior de S&atilde;o Paulo, de forma s&oacute;lida, confi&aacute;vel e duradoura.<br />\r\n			<br />\r\n			Trata-se de uma imobili&aacute;ria atuante no mercado, com um hist&oacute;rico &iacute;ntegro e de &oacute;timas negocia&ccedil;&otilde;es. &Eacute;tica profissional confian&ccedil;a e transpar&ecirc;ncia s&atilde;o imprescind&iacute;veis no mercado imobili&aacute;rio.<br />\r\n			<br />\r\n			A busca pela excel&ecirc;ncia &eacute; a maneira de crescimento neste mercado, sendo assim, a&nbsp;<strong>CONSULTORIA IMOBILI&Aacute;RIA PRUDENTE&nbsp;</strong>oferece para o seus clientes um atendimento personalizado, o que resulta em seguran&ccedil;a em todos os neg&oacute;cios realizados, satisfazendo todos os nossos clientes.<br />\r\n			<br />\r\n			A atua&ccedil;&atilde;o com dinamismo e profissionalismo na presta&ccedil;&atilde;o de servi&ccedil;os, faz da&nbsp;<strong>CONSULTORIA IMOBILI&Aacute;RIA PRUDENTE&nbsp;</strong>&nbsp;uma das empresas mais eficientes no mercado imobili&aacute;rio na regi&atilde;o de Presidente Prudente.<br />\r\n			<br />\r\n			Fa&ccedil;a parte desta fam&iacute;lia voc&ecirc; tamb&eacute;m!<br />\r\n			<br />\r\n			<strong>CONSULTORIA IMOBILI&Aacute;RIA PRUDENTE&nbsp;</strong><br />\r\n			Avenida Brasil, 2219<br />\r\n			Jardim Bela Daria - Presidente Prudente &ndash; CEP 19013-001<br />\r\n			(18) 3217-2771 (18) 32030259 (18) 9709-8750<br />\r\n			creci 28.800-J<br />\r\n			<strong>Email: imobiliariaprudente@hotmail.com</strong><br />\r\n			<br />\r\n			<strong>&aacute; partir das 9:00 hrs at&eacute; as 18:00 hrs.</strong></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','4eed35f8-9d6e-4914-9d00-cc535cf19913about-01.jpg',NULL,NULL,'Empresa','2017-06-18',NULL,NULL,NULL,NULL,NULL,1),(2,'Érico','desenvolvedor',NULL,'usuario desenvolvedor',NULL,'Usuario','2017-07-26',NULL,NULL,NULL,NULL,NULL,1),(3,'Márcio','desenvolvedor',NULL,'usuario desenvolvedor',NULL,'Usuario','2017-07-26',NULL,NULL,NULL,NULL,NULL,1),(4,'Supernova','desenvolvedor',NULL,'',NULL,'Usuario','2017-07-26',NULL,NULL,NULL,NULL,NULL,1),(5,'Prudente Imobiliária','Administrador',NULL,NULL,NULL,'Usuario','2017-07-26',NULL,NULL,NULL,NULL,NULL,1),(12,'Supernova WEB','desenvolvedora web','468a93b0-10f8-4a6e-a38c-838f3b66835a2017-m3-frente-v2.jpg','empresa parceira',NULL,'Cliente','0001-01-01',NULL,NULL,NULL,NULL,NULL,1),(13,'erico','erico','042d078d-740c-439c-97ab-0e89663adae42017-m3-frente-v2-mask.jpg','',NULL,'Cliente','2017-06-18',NULL,NULL,NULL,NULL,NULL,1),(14,'Érico','I\'m érico','4035327d-9ea7-4a4f-b305-bd8f0ccbf17ddownload.jpg','',NULL,'Equipe','2017-07-21',NULL,NULL,NULL,NULL,NULL,1),(15,'Márcio','It\'s me! Márcioo','1539dd7a-5e54-4b8c-bb72-6a5dc2219f96Mickey_Mouse.png','',NULL,'Equipe','2017-07-21',NULL,NULL,NULL,NULL,NULL,1),(16,'Prudente Imobiliária','Imobiliária Prudente','','',NULL,'Equipe','2017-07-26',NULL,'(18) 3217-2771','(18) 99709-8750','','',1),(17,'Antônio de Oliveira Netto','Corretor de imóveis','','',NULL,'Equipe','2017-09-15',NULL,'','(18) 99707-8750','','',1),(18,'Sheyla Daiane','Corretor de imóveis',NULL,NULL,NULL,'Equipe','2017-09-15',NULL,NULL,'(18) 99770-8750',NULL,NULL,1),(19,'Jacqueline Lima','Corretor de imóveis',NULL,NULL,NULL,'Equipe','2017-09-15',NULL,NULL,'(18) 99644-0638',NULL,NULL,1),(20,'Willian Castro','Corretor de imóveis',NULL,NULL,NULL,'Equipe','2017-09-15',NULL,NULL,'(18) 99655-0842',NULL,NULL,1),(21,'Thiago Martins','Corretor de imóveis',NULL,NULL,NULL,'Equipe','2017-09-15',NULL,NULL,'(18) 99626-9398',NULL,NULL,1),(22,'Edmo Ribeiro','Corretor de imóveis',NULL,NULL,NULL,'Equipe','2017-09-15',NULL,NULL,'(18) 99742-3879',