INSERT INTO `Publicacao` VALUES (15,'Consultoria Contábil  Possuímos a melhor equ','Consultoria Contábil\r\n\r\nPossuímos a melhor equipe especializada e preparada para prestar serviços de qualidade na área de consultoria contábil\r\n\r\nConsultoria Trabalhista e Previdenciária','<h4>Consultoria Cont&aacute;bil</h4>\r\n\r\n<p>Possu&iacute;mos a melhor equipe especializada e preparada para prestar servi&ccedil;os de qualidade na &aacute;rea de consultoria cont&aacute;bil</p>\r\n\r\n<h4>Consultoria Trabalhista e Previdenci&aacute;ria</h4>\r\n\r\n<p>Atrav&eacute;s de uma equipe especializada, ajudamos no acompanhamento dos procedimentos adotados nas &aacute;reas trabalhistas.</p>\r\n\r\n<h4>Consultoria Tribut&aacute;ria</h4>\r\n\r\n<p>Nossa Consultoria Fiscal e Tribut&aacute;ria est&aacute; voltada para presta&ccedil;&atilde;o de servi&ccedil;os ligados a gest&atilde;o e ao planejamento.</p>\r\n\r\n<h4>Departamento Cont&aacute;bil</h4>\r\n\r\n<p>Temos por objetivo demonstrar toda sua movimenta&ccedil;&atilde;o patrimonial.</p>\r\n','bf9d83b7-59a2-4840-9ee9-8a9cf33e1f853c4357d0b60e1a6b2d4ccb737a0fbbba.jpg','2017-08-04 22:08:00',NULL,0,0,'consultoria-contabil-possuimos-a-melhor-equ',0,4,NULL),(17,'Conselho de Segurança','Conselho de Segurança da ONU impõe novas sanções à Coreia do Norte','<p>Conselho de Seguran&ccedil;a da ONU aprovou por unanimidade neste s&aacute;bado (5) uma resolu&ccedil;&atilde;o com novas san&ccedil;&otilde;es &agrave; Coreia do Norte, ap&oacute;s dois testes de m&iacute;sseis bal&iacute;sticos intercontinentais que o pa&iacute;s realizou em julho. Segundo a ag&ecirc;ncia Reuters, as novas san&ccedil;&otilde;es poder&atilde;o reduzir em at&eacute; um ter&ccedil;o a receita de exporta&ccedil;&atilde;o anual do pa&iacute;s, que &eacute; de US$ 3 bilh&otilde;es.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><a href=\"http://g1.globo.com/mundo/noticia/tensao-com-a-coreia-do-norte-o-mundo-pode-estar-proximo-da-3a-guerra-mundial.ghtml\">O mundo pode estar pr&oacute;ximo da 3&ordf; Guerra Mundial?</a></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>A resolu&ccedil;&atilde;o, que foi apresentada pelos Estados Unidos, pro&iacute;be as exporta&ccedil;&otilde;es norte-coreanas de carv&atilde;o, ferro, min&eacute;rio de ferro, chumbo, min&eacute;rio de chumbo e frutos do mar. O texto tamb&eacute;m pro&iacute;be que pa&iacute;ses aumentem o n&uacute;mero de profissionais norte-coreanos que trabalham no exterior, a forma&ccedil;&atilde;o de novas&nbsp;<em>joint ventures</em>&nbsp;com a Coreia do Norte e qualquer novo investimento em&nbsp;<em>joint ventures</em>&nbsp;atuais. O resolu&ccedil;&atilde;o ainda acrescenta 9 indiv&iacute;duos e 4 entidades norte-coreanas &agrave; lista negra da ONU, incluindo o principal banco de c&acirc;mbio do pa&iacute;s, sujeitando-os a congelamento global de ativos e proibi&ccedil;&atilde;o de viagem ao exterior.</p>\r\n\r\n<p>A embaixadora dos EUA na ONU, Nikki Haley, afirmou durante a reuni&atilde;o que as novas medidas implicam em a&ccedil;&otilde;es que ter&atilde;o um impacto forte sobre a Coreia do Norte em resposta a uma escalada armament&iacute;cia que &quot;tem que parar&quot;. Ap&oacute;s a aprova&ccedil;&atilde;o das novas san&ccedil;&otilde;es, Haley disse que esse &eacute; &quot;o maior pacote econ&ocirc;mico j&aacute; aprovado contra o regime da Coreia do Norte&quot;.</p>\r\n','15a858a7-3bb5-48eb-b311-3cedfcb24c84coach-executivo-carreira1.jpg','2017-08-05 18:28:00',NULL,0,0,'conselho-de-seguranca',0,3,NULL),(18,'Netflix aumenta preços no Brasil; veja os novos valores de assinatura','Empresa comunicou aumentos para os clientes em julho; preços vão variar entre R$ 19,90 e R$ 37,90','<p>assinantes do Netflix, servi&ccedil;o de streaming de v&iacute;deos, v&atilde;o pagar mais caro pelos seus planos a partir deste domingo (6). Dos tr&ecirc;s pacotes oferecidos, apenas o plano b&aacute;sico ter&aacute; os pre&ccedil;os mantidos.</p>\r\n\r\n<p>O reajuste foi comunicado em julho para os clientes da empresa. Os novos pre&ccedil;os j&aacute; est&atilde;o valendo para novos assinantes desde a segunda quinzena de julho.</p>\r\n\r\n<p>Veja os novos pre&ccedil;os do Netflix no Brasil</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Plano</td>\r\n			<td>Servi&ccedil;os</td>\r\n			<td>Valor antigo</td>\r\n			<td>Novo valor</td>\r\n		</tr>\r\n		<tr>\r\n			<td>B&aacute;sico</td>\r\n			<td>Tela &uacute;nica e sem HD</td>\r\n			<td>R$ 19,90</td>\r\n			<td>R$ 19,90</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Padr&atilde;o</td>\r\n			<td>Duas telas simult&acirc;neas e conte&uacute;do HD</td>\r\n			<td>R$ 22,90</td>\r\n			<td>R$ 27,90</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Premium</td>\r\n			<td>Quatro telas simult&acirc;neas e qualidade 4k</td>\r\n			<td>R$ 29,90</td>\r\n			<td>R$ 37,90</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Fonte: Netflix</p>\r\n\r\n<p>O Netflix n&atilde;o reajustava seus pre&ccedil;os no Brasil desde 2015. No &uacute;ltimo aumento, a empresa deu um b&ocirc;nus para os antigos assinantes por mais um ano e s&oacute; reajustou o pre&ccedil;o das novas assinaturas.</p>\r\n\r\n<p>O Brasil n&atilde;o &eacute; o &uacute;nico pa&iacute;s em que os pre&ccedil;os do Netflix est&atilde;o subindo. Na Austr&aacute;lia, a assinatura do servi&ccedil;os subiu 20% em julho.</p>\r\n\r\n<p><img alt=\"Seriado House of Cards é uma das produções próprias do Netflix (Foto: Divulgação/Netflix)\" src=\"data:image/jpeg;base64,\" title=\"Seriado House of Cards é uma das produções próprias do Netflix (Foto: Divulgação/Netflix)\" /></p>\r\n\r\n<p><img alt=\"Seriado House of Cards é uma das produções próprias do Netflix (Foto: Divulgação/Netflix)\" src=\"https://s2.glbimg.com/wXeTg0kwOGIw_Rl94ImPvY5Z-s0=/0x0:690x400/984x0/smart/filters:strip_icc()/s.glbimg.com/jo/g1/f/original/2017/07/21/hoc5.jpg\" title=\"Seriado House of Cards é uma das produções próprias do Netflix (Foto: Divulgação/Netflix)\" /></p>\r\n\r\n<p>Seriado House of Cards &eacute; uma das produ&ccedil;&otilde;es pr&oacute;prias do Netflix (Foto: Divulga&ccedil;&atilde;o/Netflix)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Mais clientes premium</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Al&eacute;m dos aumentos no valor da assinatura, o Netflix tenta elevar sua rentabilidade com uma venda maior de pacotes premium.</p>\r\n','e7b7132d-2099-4660-ace4-84d5078aa816Psychology2.jpg','2017-08-07 08:47:00',NULL,0,0,'netflix-aumenta-precos-no-brasil;-veja-os-novos-valores-de-assinatura',0,3,NULL),(19,'10 fatos sobre Jorge Paulo Lemann, o homem mais rico do Brasil','Ele é pentacampeão de tênis, mentor da fusão de Brahma e Antarctica, dono do Burger King e sócio do bilionário Warren Buffett; conheça mais sobre o empresário.\r\n','<p>empres&aacute;rio Jorge Paulo Lemann, primeiro do ranking de bilion&aacute;rios brasileiros, far&aacute; uma das suas poucas apari&ccedil;&otilde;es p&uacute;blicas nesta segunda-feira (7), em S&atilde;o Paulo. Ele vai participar de palestra da Funda&ccedil;&atilde;o Estudar, entidade apoiada por ele que oferece bolsas de estudos em cursos no Brasil e no exterior.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"Saiba 10 fatos sobre Jorge Paulo Lemann\" src=\"https://s02.video.glbimg.com/x720/6057413.jpg\" title=\"Saiba 10 fatos sobre Jorge Paulo Lemann\" /></p>\r\n\r\n<p>Saiba 10 fatos sobre Jorge Paulo Lemann</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Veja 10 fatos sobre Jorge Paulo Lemann:</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>&Eacute; o homem mais rico do Brasil e o 22&ordm; do mundo, com fortuna estimada em US$ 29 bilh&otilde;es no ranking da revista Forbes de 2017.</li>\r\n	<li>Mora na Su&iacute;&ccedil;a. Lemman nasceu no Rio de Janeiro, mas &eacute; filho de imigrantes su&iacute;&ccedil;os.</li>\r\n	<li>Foi um dos mentores da fus&atilde;o de Brahma e Antarctica, que criou a Ambev.</li>\r\n	<li>&Eacute; acionista do Burger King.</li>\r\n	<li>&Eacute; s&oacute;cio de Warren Buffett, o 2&ordm; homem mais rico do mundo. Os dois s&atilde;o donos do ketchup Heinz.</li>\r\n	<li>Investe em startups. Seu fundo &eacute; s&oacute;cio da Diletto e da dona do iFood.</li>\r\n	<li>&Eacute; obsessivo por metas e resultado e defende uma cultura de meritocracia.</li>\r\n	<li>Financia bolsas de estudos. &Eacute; apoiador da Funda&ccedil;&atilde;o Lemann e da Funda&ccedil;&atilde;o Estudar.</li>\r\n	<li>Foi jogador de t&ecirc;nis profissional e pentacampe&atilde;o brasileiro.</li>\r\n	<li>&#39;Sonho grande&#39;, o nome do livro que conta a hist&oacute;ria de Lemann e seus s&oacute;cios, foi inspirado em um de seus lemas: &quot;sonhar grande d&aacute; o mesmo trabalho que sonhar pequeno&rdquo;.</li>\r\n</ol>\r\n',NULL,'2017-08-07 08:49:00',NULL,0,0,'10-fatos-sobre-jorge-paulo-lemann-o-homem-mais-rico-do-brasil',0,3,NULL),(25,'10 fatos sobre Jorge Paulo Lemann','Ele é pentacampeão de tênis, mentor da fusão de Brahma e Antarctica, dono do Burger King e sócio do bilionário Warren Buffett;','<p>empres&aacute;rio Jorge Paulo Lemann, primeiro do ranking de bilion&aacute;rios brasileiros, far&aacute; uma das suas poucas apari&ccedil;&otilde;es p&uacute;blicas nesta segunda-feira (7), em S&atilde;o Paulo. Ele vai participar de palestra da Funda&ccedil;&atilde;o Estudar, entidade apoiada por ele que oferece bolsas de estudos em cursos no Brasil e no exterior.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"Saiba 10 fatos sobre Jorge Paulo Lemann\" src=\"https://s02.video.glbimg.com/x720/6057413.jpg\" title=\"Saiba 10 fatos sobre Jorge Paulo Lemann\" /></p>\r\n\r\n<p>Saiba 10 fatos sobre Jorge Paulo Lemann</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Veja 10 fatos sobre Jorge Paulo Lemann:</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>&Eacute; o homem mais rico do Brasil e o 22&ordm; do mundo, com fortuna estimada em US$ 29 bilh&otilde;es no ranking da revista Forbes de 2017.</li>\r\n	<li>Mora na Su&iacute;&ccedil;a. Lemman nasceu no Rio de Janeiro, mas &eacute; filho de imigrantes su&iacute;&ccedil;os.</li>\r\n	<li>Foi um dos mentores da fus&atilde;o de Brahma e Antarctica, que criou a Ambev.</li>\r\n	<li>&Eacute; acionista do Burger King.</li>\r\n	<li>&Eacute; s&oacute;cio de Warren Buffett, o 2&ordm; homem mais rico do mundo. Os dois s&atilde;o donos do ketchup Heinz.</li>\r\n	<li>Investe em startups. Seu fundo &eacute; s&oacute;cio da Diletto e da dona do iFood.</li>\r\n	<li>&Eacute; obsessivo por metas e resultado e defende uma cultura de meritocracia.</li>\r\n	<li>Financia bolsas de estudos. &Eacute; apoiador da Funda&ccedil;&atilde;o Lemann e da Funda&ccedil;&atilde;o Estudar.</li>\r\n	<li>Foi jogador de t&ecirc;nis profissional e pentacampe&atilde;o brasileiro.</li>\r\n	<li>&#39;Sonho grande&#39;, o nome do livro que conta a hist&oacute;ria de Lemann e seus s&oacute;cios, foi inspirado em um de seus lemas: &quot;sonhar grande d&aacute; o mesmo trabalho que sonhar pequeno&rdquo;.</li>\r\n</ol>\r\n','83c489b3-ff8f-4762-92e8-e6b3e80e8de23c4357d0b60e1a6b2d4ccb737a0fbbba.jpg','2017-08-07 08:51:00',NULL,0,0,'10-fatos-sobre-jorge-paulo-lemann',0,3,NULL),(29,'Centrão avisa a Temer que não vai votar reforma da Previdência','Deputados do Centrão mandaram avisar ao presidente Michel Temer que não irão votar a reforma da Previdência Social, informa o repórter Nilson Klava, da GloboNews.','<p>L&iacute;deres dos tr&ecirc;s principais partidos do centr&atilde;o &ndash; PP, PR e PSD &ndash; afirmam que n&atilde;o h&aacute; condi&ccedil;&otilde;es de aprovar a reforma, ainda mais depois do desgaste de terem votado contra o prosseguimento da den&uacute;ncia contra Temer. Ainda mais em v&eacute;spera de ano eleitoral.<br />\r\n<br />\r\n&quot;Reforma da Previd&ecirc;ncia se vota no in&iacute;cio de mandato. Em final de mantado, &eacute; muito perigoso colocarmos uma mat&eacute;ria dessa, ainda mais no momento em que estamos vivendo na C&acirc;mara dos Deputados&quot;, disse o l&iacute;der do PR, Jos&eacute; Rocha (BA).<br />\r\n<br />\r\nO Centr&atilde;o quer deixar claro ao governo a insatisfa&ccedil;&atilde;o com o espa&ccedil;o pol&iacute;tico dado a partidos que n&atilde;o votaram majoritariamente a favor de Temer: PSDB e PSB.<br />\r\n<br />\r\n&quot;O momento &eacute; muito delicado, n&atilde;o temos unidade na bancada para isso [votar a reforma]. N&oacute;s esperamos que o governo tenha um sentimento de reagrupa&ccedil;&atilde;o e senso de responsabilidade de saber quem realmente &eacute; base e quem n&atilde;o &eacute;&quot;, acrescentou o l&iacute;der do PP, Artur Lira (AL).<br />\r\n<br />\r\nL&iacute;deres do Centr&atilde;o alertam, ainda, para o fato de que h&aacute; no meio pol&iacute;tico uma expectativa de que o procurador-geral da Rep&uacute;blica, Rodrigo Janot, ofere&ccedil;a nova den&uacute;ncia contra Temer por obstru&ccedil;&atilde;o de Justi&ccedil;a.<br />\r\n<br />\r\n&quot;A reforma tem que ser votada dentro de uma uniformidade da base, e o governo n&atilde;o tem essa uniformidade. A discuss&atilde;o da Previd&ecirc;ncia abre a porta para sociedade ir para as ruas, &eacute; tudo o que o governo tem que evitar diante de uma segunda den&uacute;ncia&quot;, afirma o l&iacute;der do PSD, Marcos Montes (MG).<br />\r\n<br />\r\n<strong>O peso do Centr&atilde;o</strong><br />\r\nJuntas, as bancas de PP, PR e PSD somam 123 deputados. Na vota&ccedil;&atilde;o da den&uacute;ncia, os tr&ecirc;s partidos deram 87 dos 263 votos a favor de Temer.<br />\r\n<br />\r\nPara aprovar a reforma da Previd&ecirc;ncia, o governo precisa de 308 votos. Por isso o governo tem usado o discurso de aprovar o texto &quot;poss&iacute;vel&quot;. O Planalto defende o parecer de Arthur Maia (PPS-BA), aprovado na comiss&atilde;o especial da C&acirc;mara.<br />\r\n<br />\r\n&quot;A base da conversa come&ccedil;a com o relat&oacute;rio&quot;, observou o ministro da Secretaria-Geral, Moreira Franco (PMDB-RJ).</p>\r\n','76243293-aee5-4867-b294-607fc5e60716coaching-executivo.jpg','2017-08-09 07:27:00',NULL,0,0,'centrao-avisa-a-temer-que-nao-vai-votar-reforma-da-previdencia',0,3,NULL),(30,'Reforma política','A comissão da Câmara destinada a analisar um dos projetos de reforma política remarcou para hoje a votação de relatório prevista para ontem.','<p>A comiss&atilde;o da C&acirc;mara destinada a analisar um dos projetos de reforma pol&iacute;tica remarcou para hoje a vota&ccedil;&atilde;o de relat&oacute;rio prevista para ontem. A&nbsp;<a href=\"http://g1.globo.com/politica/noticia/sem-consenso-comissao-cancela-votacao-de-relatorio-da-reforma-politica.ghtml\">reuni&atilde;o de ter&ccedil;a foi cancelada</a>&nbsp;por causa das diverg&ecirc;ncias entre os partidos. A proposta altera o sistema eleitoral e cria um fundo com recursos p&uacute;blicos para bancar campanhas dos candidatos. As mudan&ccedil;as precisam ser aprovadas at&eacute; outubro para valerem j&aacute; nas elei&ccedil;&otilde;es de 2018.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><a href=\"http://g1.globo.com/politica/noticia/apos-jantar-eunicio-diz-que-ha-consenso-sobre-voto-distritao-em-de-2018.ghtml\">Ap&oacute;s jantar, Eun&iacute;cio diz que h&aacute; consenso sobre &#39;distrit&atilde;o&#39; em 2018; v&iacute;deo</a></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"Plenário da comissão da reforma política ficou vazio com o cancelamento da reunião (Foto: Bernardo Caram/G1)\" src=\"data:image/jpeg;base64,\" title=\"Plenário da comissão da reforma política ficou vazio com o cancelamento da reunião (Foto: Bernardo Caram/G1)\" /></p>\r\n\r\n<p><img alt=\"Plenário da comissão da reforma política ficou vazio com o cancelamento da reunião (Foto: Bernardo Caram/G1)\" src=\"https://s2.glbimg.com/pE359aovcrGHuTDNSVUT68XMWc8=/0x0:1032x581/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2017/7/w/Yx2Dg0T6ae6RUASxBl2Q/whatsapp-image-2017-08-08-at-15.05.15.jpeg\" title=\"Plenário da comissão da reforma política ficou vazio com o cancelamento da reunião (Foto: Bernardo Caram/G1)\" /></p>\r\n\r\n<p>Plen&aacute;rio da comiss&atilde;o da reforma pol&iacute;tica ficou vazio com o cancelamento da reuni&atilde;o (Foto: Bernardo Caram/G1)</p>\r\n','883a57ee-0a31-4c23-abe8-b2a91ce0d2b83c4357d0b60e1a6b2d4ccb737a0fbbba.jpg','2017-08-09 07:38:00',NULL,0,0,'reforma-politica',0,3,NULL),(31,'Reajuste no STF?','Ministros do Supremo se reúnem para decidir sobre o Orçamento do STF para 2018. Presidente Cármen Lúcia já adiantou que é contra reajuste para magistrados.','<p>Ministros do Supremo se re&uacute;nem para decidir sobre o Or&ccedil;amento do STF para 2018. Presidente&nbsp;<a href=\"http://g1.globo.com/politica/blog/cristiana-lobo/post/carmen-lucia-decide-nao-propor-aumento-para-o-judiciario-em-2018.html\">C&aacute;rmen L&uacute;cia j&aacute; adiantou que &eacute; contra reajuste para magistrados</a>.</p>\r\n\r\n<p><img alt=\"Cármen Lúcia (Foto: AP Photo / Eraldo Peres)\" src=\"data:image/jpeg;base64,\" title=\"Cármen Lúcia (Foto: AP Photo / Eraldo Peres)\" /></p>\r\n\r\n<p><img alt=\"Cármen Lúcia (Foto: AP Photo / Eraldo Peres)\" src=\"https://s2.glbimg.com/P73p-nzsOlCOjDjlc2ZRmSSselg=/0x0:2000x1333/984x0/smart/filters:strip_icc()/s.glbimg.com/jo/g1/f/original/2017/06/28/brazil_political_cris_fran_dRxT93l.jpg\" title=\"Cármen Lúcia (Foto: AP Photo / Eraldo Peres)\" /></p>\r\n\r\n<p>C&aacute;rmen L&uacute;cia (Foto: AP Photo / Eraldo Peres)</p>\r\n','7b552a2e-edb1-4431-914b-fed0999a0591coach-executivo-carreira1.jpg','2017-08-09 07:38:00',NULL,0,0,'reajuste-no-stf',0,3,NULL),(32,'Juiz decide não prorrogar prisão','Juiz decide não prorrogar prisão e determina soltura de policiais suspeitos de envolvimento em chacina no PA\r\nMagistrado determinou que policiais presos por suspeita de participação em chacina','<p><img alt=\"Trabalhadores rurais mortos em operação policial foram enterrados no Pará (Foto: Mario Campagnani/Justiça Global/Divulgação)\" src=\"data:image/jpeg;base64,\" title=\"Trabalhadores rurais mortos em operação policial foram enterrados no Pará (Foto: Mario Campagnani/Justiça Global/Divulgação)\" /></p>\r\n\r\n<p><img alt=\"Trabalhadores rurais mortos em operação policial foram enterrados no Pará (Foto: Mario Campagnani/Justiça Global/Divulgação)\" src=\"https://s2.glbimg.com/S6rLBXphxPonyxUGc-iEelvxaEE=/0x0:976x549/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2017/7/D/3PBisCShW7phmAXfwYfg/2-cemiterio-de-vitimas-da-chacina-de-pau-darco-no-para.jpg\" title=\"Trabalhadores rurais mortos em operação policial foram enterrados no Pará (Foto: Mario Campagnani/Justiça Global/Divulgação)\" /></p>\r\n\r\n<p>Trabalhadores rurais mortos em opera&ccedil;&atilde;o policial foram enterrados no Par&aacute; (Foto: Mario Campagnani/Justi&ccedil;a Global/Divulga&ccedil;&atilde;o)</p>\r\n\r\n<p><iframe frameborder=\"0\" height=\"250\" id=\"google_ads_iframe_/95377733/tvg_G1/Sua_Regiao&gt;Norte&gt;Para_1\" name=\"\" scrolling=\"no\" src=\"http://tpc.googlesyndication.com/safeframe/1-0-9/html/container.html\" title=\"3rd party ad content\" width=\"300\"></iframe></p>\r\n\r\n<p>O juiz de Reden&ccedil;&atilde;o Jun Kubota decidiu, nesta ter&ccedil;a-feira (8), indeferir o pedido de prorroga&ccedil;&atilde;o da&nbsp;<a href=\"http://g1.globo.com/pa/para/noticia/justica-determina-prisao-de-13-policiais-envolvidos-em-operacao-que-matou-trabalhadores-rurais-em-pau-darco.ghtml\">pris&atilde;o tempor&aacute;ria dos 13 policiais</a>suspeitos de participa&ccedil;&atilde;o na&nbsp;<a href=\"http://g1.globo.com/pa/para/noticia/chacina-que-resultou-na-morte-de-10-pessoas-no-para-completa-uma-semana-entenda.ghtml\">chacina que resultou na morte de 10 trabalhadores rurais em Pau D&#39;arco</a>, sudeste do Par&aacute;, alegando que a pris&atilde;o dos policiais n&atilde;o &eacute; necess&aacute;ria para a conclus&atilde;o das investiga&ccedil;&otilde;es.</p>\r\n\r\n<p>De acordo com o Kubota,<a href=\"http://g1.globo.com/pa/para/noticia/governo-do-para-afirma-que-vitimas-de-chacina-em-pau-darco-foram-executadas.ghtml\">&nbsp;embora existam provas do envolvimento dos policiais na autoria dos crimes</a>, estas provas s&atilde;o insuficientes para manter a pris&atilde;o tempor&aacute;ria dos 11 policiais militares e dois policiais civis suspeitos de terem executado os trabalhadores rurais na fazenda Santa L&uacute;cia em maio de 2017.</p>\r\n','f42fc9ef-e8c8-4e6d-9428-615d248154b8coaching-executivo.jpg','2017-08-09 07:39:00',NULL,0,0,'juiz-decide-nao-prorrogar-prisao',0,3,NULL),(33,'Faculdades privadas aceitam nota do Enem ','Faculdades privadas aceitam nota do Enem abaixo da média exigida por Fies e Prouni para matricular novos alunos','<h2>Corte exigido pelo MEC para o Prouni e o Fies &eacute; de 450 pontos; algumas institui&ccedil;&otilde;es pedem apenas que o candidato n&atilde;o tenha zerado o Enem.</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>Por Clara Campoli, G1</p>\r\n\r\n<p>09/08/2017 06h01&nbsp;&nbsp;Atualizado h&aacute; 1 hora</p>\r\n\r\n<p><img alt=\"Caderno de prova do Enem 2016 (Foto: Arquivo/G1)\" src=\"data:image/jpeg;base64,\" title=\"Caderno de prova do Enem 2016 (Foto: Arquivo/G1)\" /><img alt=\"Caderno de prova do Enem 2016 (Foto: Arquivo/G1)\" src=\"https://s2.glbimg.com/68QQLnHjG0j0lCVfqlU7dsfRfMk=/0x0:1280x720/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2016/u/6/PQ7yliR0aw4S0ojOQ31g/cadernoenem.jpg\" title=\"Caderno de prova do Enem 2016 (Foto: Arquivo/G1)\" /></p>\r\n\r\n<p>Caderno de prova do Enem 2016 (Foto: Arquivo/G1)</p>\r\n\r\n<p><iframe frameborder=\"0\" height=\"250\" id=\"google_ads_iframe_/95377733/tvg_G1/Educacao_1\" name=\"\" scrolling=\"no\" src=\"http://tpc.googlesyndication.com/safeframe/1-0-9/html/container.html\" title=\"3rd party ad content\" width=\"300\"></iframe></p>\r\n\r\n<p>Com o Exame Nacional do Ensino M&eacute;dio (<a href=\"http://g1.globo.com/educacao/enem/\">Enem</a>) cada vez mais difundido como forma de ingresso no ensino superior, &eacute; comum que institui&ccedil;&otilde;es particulares utilizem a nota dos alunos como pontua&ccedil;&atilde;o do vestibular. A nota de corte exigida, no entanto, n&atilde;o se aproxima do padr&atilde;o estabelecido pelo Minist&eacute;rio da Educa&ccedil;&atilde;o (<a href=\"http://g1.globo.com/tudo-sobre/ministerio-da-educacao\">MEC</a>) como refer&ecirc;ncia, por exemplo, para o Programa Universidade Para Todos (Prouni) ou o Fundo de inanciamento Estudantil (<a href=\"http://g1.globo.com/tudo-sobre/fies\">Fies</a>).</p>\r\n\r\n<p>Enquanto os programas governamentais exigem um m&iacute;nimo de 450 pontos para inscri&ccedil;&atilde;o em processos como o Prouni ou Fies, todas as institui&ccedil;&otilde;es procuradas pelo&nbsp;<strong>G1</strong>&nbsp;exigem menos do que isso. Algumas solicitam ao menos 300 pontos, quando a&nbsp;<a href=\"http://g1.globo.com/educacao/enem/2015/noticia/2016/01/nota-em-matematica-com-10083-pontos-e-recorde-no-enem-diz-inep.html\">nota mais baixa do Enem 2016 foi 280,2</a>. Outras pedem apenas que o estudante n&atilde;o tenha zerado o Enem, uma prova que vale em torno de mil pontos.</p>\r\n\r\n<p>N&atilde;o existe jurisprud&ecirc;ncia do MEC ou da Associa&ccedil;&atilde;o Brasileira de Mantenedoras de Ensino Superior (Abmes) sobre o assunto: cada institui&ccedil;&atilde;o tem a liberdade para definir a forma de ingresso dos candidatos, bem como a nota exigida de cada um.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<blockquote>&quot;N&atilde;o tem uma regra geral, como &eacute; o caso do Prouni e do Fies. Cada institui&ccedil;&atilde;o tem a prerrogativa de determinar quais crit&eacute;rios vai utilizar na sele&ccedil;&atilde;o&quot;, diz o diretor executivo da Abmes, S&oacute;lon Caldas.</blockquote>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Das sete institui&ccedil;&otilde;es que responderam ao questionamento do&nbsp;<strong>G1</strong>, quatro exigem a nota m&iacute;nima de 300 pontos no Enem para que o aluno participe do processo seletivo: Cruzeiro do Sul, Anhembi-Morumbi, FMU e Est&aacute;cio de S&aacute;.</p>\r\n\r\n<p>No Centro Universit&aacute;rio S&atilde;o Camilo, exige-se que o candidato n&atilde;o tenha zerado a reda&ccedil;&atilde;o e que tenha obtino no m&iacute;nimo 20 pontos na prova objetiva. Na Anhanguera, basta n&atilde;o ter zerado o Enem. A S&atilde;o Judas n&atilde;o informou as notas de corte para ingresso, mas ressaltou que o estudante n&atilde;o pode ter tirado nota zero na reda&ccedil;&atilde;o.</p>\r\n\r\n<p><iframe frameborder=\"0\" height=\"250\" id=\"google_ads_iframe_/95377733/tvg_G1/Educacao_2\" name=\"google_ads_iframe_/95377733/tvg_G1/Educacao_2\" scrolling=\"no\" title=\"3rd party ad content\" width=\"970\"></iframe></p>\r\n\r\n<p>&quot;O que difere do processo tradicional &eacute; que o aluno que ingressa via nota do Enem n&atilde;o precisa vir fazer a prova, basta preencher uma ficha de inscri&ccedil;&atilde;o. O corte depende do &iacute;ndice da prova, mas normalmente o aluno que ingressa na institui&ccedil;&atilde;o tem uma nota muito boa. Temos concursos de bolsas, e um n&uacute;mero grande de estudantes que conseguiram vieram com boas notas no Enem&quot;, comenta a respons&aacute;vel pela Central de Atendimento ao Candidato da S&atilde;o Judas, Alyssa Scarcini.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Novas regras do Fies</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>O diretor executivo da Abmes, S&oacute;lon Caldas, aponta as&nbsp;<a href=\"http://g1.globo.com/educacao/noticia/2016/04/fies-tera-mudancas-para-estimular-participacao-no-programa-diz-ministro.html\">novas regras do Fies</a>&nbsp;como um fator motivador para essas condi&ccedil;&otilde;es de entrada no ensino superior. &quot;Quando o governo mudou as regras, as exig&ecirc;ncias ficaram muito restritivas. De um lado, temos o aluno que quer a vaga. Do outro, temos vagas sobrando. Os alunos n&atilde;o t&ecirc;m condi&ccedil;&otilde;es de atender a todos os requisitos&quot;, lamenta.</p>\r\n\r\n<p>Questionado sobre o baixo crivo estabelecido pelas institui&ccedil;&otilde;es, Caldas garante que isso n&atilde;o significa perda de qualidade no ensino. &quot;A nota do Enem n&atilde;o necessariamente quer dizer que o aluno &eacute; bom ou ruim. Os estudantes mais pobres, que fazem o ensino b&aacute;sico em escolas p&uacute;blicas e t&ecirc;m defici&ecirc;ncias nessa etapa, s&atilde;o os que v&atilde;o para as faculdades particulares. Corremos o risco de penalizarmos o aluno duas vezes. Primeiro, porque ele estuda nas piores escolas. E depois ele n&atilde;o pode entrar no ensino superior? Talvez estejamos penalizando pessoas que n&atilde;o tiveram oportunidade de ingresso em escolas superiores&quot;, pondera.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<blockquote>&quot;A nota do Enem n&atilde;o necessariamente quer dizer que o aluno &eacute; bom ou ruim. Os estudantes mais pobres, que fazem o ensino b&aacute;sico em escolas p&uacute;blicas e t&ecirc;m defici&ecirc;ncias nessa etapa, s&atilde;o os que v&atilde;o para as faculdades particulares.&quot; - S&oacute;lon Caldas</blockquote>\r\n','1d08e05f-4157-4c56-94fd-7c76d9c9a0af3c4357d0b60e1a6b2d4ccb737a0fbbba.jpg','2017-08-09 07:41:00',NULL,0,0,'faculdades-privadas-aceitam-nota-do-enem-',0,3,NULL);
