INSERT INTO `Servico` VALUES (1,'Físcal','Sua empresa com uma assessoria completa para atender a todas as obrigações fiscais.','<p>Sua empresa com uma assessoria completa para atender a todas as obriga&ccedil;&otilde;es fiscais.</p>\r\n','fa-globe',NULL,NULL,2,1),(2,'Departamento Societário','Oferecemos apoio constante na elaboração de documentação necessária para sua empresa em todos os órgãos obrigatórios.','<p>Seja para quem est&aacute; iniciando um novo neg&oacute;cio ou para quem somente procura alterar e legalizar sua empresa, a MIGRACON CONTABILIDADE oferece apoio constante na elaborando da documenta&ccedil;&atilde;o necess&aacute;ria para sua constitui&ccedil;&atilde;o, altera&ccedil;&atilde;o e baixa do registro de sua empresa em todos os &oacute;rg&atilde;os e reparti&ccedil;&otilde;es obrigat&oacute;rias. Garantimos agilidade nos servi&ccedil;os prestados para que o empres&aacute;rio possa rapidamente obter seu registro, sem necessidade de atraso no in&iacute;cio das atividades.</p>\r\n','fa-handshake-o',NULL,NULL,1,1),(3,'Departamento Contábil','Temos por objetivo demonstrar toda sua movimentação patrimonial.','Nossos serviços na área contábil tem por objetivo demonstrar toda sua movimentação patrimonial que será feita com a exata aplicação das leis e normas reguladoras. Procuramos também sempre prestar orientação e assessoria, a fim de tornar seu negócio mais rentável e com um planejamento sólido e eficaz para o futuro','fa-gavel',NULL,NULL,1,1),(4,'Departamento Tributário / Fiscal','Temos como objetivo manter todas as obrigações fiscais da empresa em dia, além de encontra','Nossos serviços na área fiscal e tributária tem como objetivo manter todas as obrigações fiscais da empresa em dia, além de encontrar a solução tributária mais viável e inteligente para o seu negócio, de acordo com a legislação vigente, para gerar economia e rentabilidade máxima para a sua empresa.','fa-calendar-plus-o',NULL,NULL,1,1),(5,'Departamento Trabalhista','Oferecemos apoio completo às empresas para cumprimento das obrigações trabalhista e previdenciária.','<p>Oferecemos apoio completo &agrave;s empresas para cumprimento das obriga&ccedil;&otilde;es trabalhista e previdenci&aacute;ria, prestando suporte tamb&eacute;m aos colaboradores de nossos clientes, para que sempre possa haver uma rela&ccedil;&atilde;o amig&aacute;vel, correta e transparente. Preparamos toda a documenta&ccedil;&atilde;o prevista em lei e elaboramos o registro de funcion&aacute;rios e demais obriga&ccedil;&otilde;es, proporcionando constantemente seguran&ccedil;a e facilidade no gerenciamento do quadro de colaboradores da empresa.</p>\r\n','fa-briefcase',NULL,NULL,1,1),(6,'Departamento Rural','Rotinas pertinentes à atividade rural tais como, apuração e controle dos estoques de gado para vacinação.','<p>Rotinas pertinentes &agrave; atividade rural tais como, apura&ccedil;&atilde;o e controle dos estoques de gado para vacina&ccedil;&atilde;o, escritura&ccedil;&atilde;o cont&aacute;bil.</p>\r\n','fa-truck',NULL,NULL,1,1),(7,'Consultoria Contábil','Possuímos a melhor equipe especializada e preparada para prestar serviços de qualidade na área de consultoria contábil ','<p>A MIGRACON CONATBILIDADE possui equipe especializada e preparada para prestar servi&ccedil;os de qualidade na &aacute;rea de consultoria cont&aacute;bil e de custos para empresas de pequeno, m&eacute;dio e grande porte.</p>\r\n','fa-bitcoin',NULL,NULL,1,1),(8,'Consultoria Trabalhista e Previdenciária','Através de uma equipe especializada, ajudamos no acompanhamento dos procedimentos adotados nas áreas trabalhistas.','<p>A MIGRACON CONATBILIDADE, atrav&eacute;s de uma equipe especializada, pode ajudar no acompanhamento dos procedimentos adotados nas &aacute;reas Trabalhista e Previdenci&aacute;ria das empresas, trabalhando desde a admiss&atilde;o at&eacute; a demiss&atilde;o, analisando e mensurando poss&iacute;veis contig&ecirc;ncias com sugest&otilde;es de melhoria de controle interno</p>\r\n','fa-support',NULL,NULL,1,1),(9,'Consultoria Tributária','Nossa Consultoria Fiscal e Tributária está voltada para prestação de serviços ligados a gestão e ao planejamento.','<p>Nossa Consultoria Fiscal e Tribut&aacute;ria est&aacute; voltada para presta&ccedil;&atilde;o de servi&ccedil;os ligados a gest&atilde;o e ao planejamento tribut&aacute;rio para pequenas, m&eacute;dias e grandes empresas.</p>\r\n','fa-trophy',NULL,NULL,1,1),(10,'Contabilidade','Nosso departamento contábil está pronto a atender as necessidades legais da sua empresa.','<p>Nosso departamento cont&aacute;bil est&aacute; pronto a atender as necessidades legais da sua empresa.</p>\r\n','fa-calculator',NULL,'contabilidade',2,1),(11,'Departamento Pessoal','Imprescindível para qualquer empresa, sendo responsável pela execução de toda a rotina de departamento de pessoal.','<p>Imprescind&iacute;vel para qualquer empresa, sendo respons&aacute;vel pela execu&ccedil;&atilde;o de toda a rotina de departamento de pessoal.</p>\r\n','fa-users',NULL,'departamento-pessoal',2,1),(12,'Societário','Serviços completos em questões que envolvem a parte legal das empresas junto aos órgãos públicos e privados.','<p>Servi&ccedil;os completos em quest&otilde;es que envolvem a parte legal (administrativa) das empresas junto aos &oacute;rg&atilde;os p&uacute;blicos e privados.</p>\r\n','fa-thumbs-up',NULL,'societario',2,1),(13,'Abertura de Empresa.','Abra sua empresa com a estrutura societária mais adequada, sempre com foco na economia tributária.','<p>Abra sua empresa com a estrutura societ&aacute;ria mais adequada, sempre com foco na economia tribut&aacute;ria.</p>\r\n','fa-briefcase',NULL,'abertura-de-empresa',2,1),(14,'Financeiro','Terceirização do Financeiro permite que você mantenha-se focado na gestão dos seus négocios.','<p>Terceiriza&ccedil;&atilde;o do Financeiro permite que voc&ecirc; mantenha-se focado na gest&atilde;o dos seus n&eacute;gocios.</p>\r\n','fa-money',NULL,'financeiro',2,1);
